import React from 'react';

function Sidebar() {
  return (
    <div className="sidebar">
      <ul>
        <li>Dashboard</li>
        <li>Relatórios</li>
        <li>Despesas</li>
        <li>Investimentos</li>
        <li>Cartões</li>
        <li>Metas</li>
        <li>Editar Perfil</li>
        <li>Informações</li>
      </ul>
    </div>
  );
}

export default Sidebar;
